import React from 'react';
import Expo from './Home';
import './style.css'

function App() {
  return (
    <div>
      <h1 id="logo">SPORTINFO24</h1>
  <Expo />
  <img src="./fb.jpg" loading="lazy"/>
  <img src="./twitter.png" loading="lazy"/>
  <img src="./instagram.png" loading="lazy"/>

  </div>
  );
}

export default App;
